jQuery(document).ready(function(b){var a={init:function(){this.attach()},attach:function(){if(qa_file_uploader.upload_enabled!=="1"){return}var c=new plupload.Uploader(qa_file_uploader.plupload);b("#file-uploader").click(function(d){alert("Hello");c.start();d.preventDefault()});c.init();c.bind("FilesAdded",function(d,e){b.each(e,function(g,f){if(f){b("#file-upload-container .loading").css("display","block");b("#file-upload-container .loading").html(f.name+", Size: "+plupload.formatSize(f.size))}});c.start()});c.bind("Error",function(d,e){b("#file-upload-container .loading").html("Error: "+e.code+", Message: "+e.message+"File:"+e.file.name);b("#file-upload-container .loading").fadeIn()});c.bind("FileUploaded",function(e,i,g){var d=b.parseJSON(g.response);if(d.success){var k=d.html.attach_src;var f=d.html.attach_id;var j=d.html.attach_title;var h='<div attach_id="'+f+'"  class="file"><div class="preview"><img src="'+k+'" title="'+j+'" /></div><div class="name">'+j+'</div><span attach_id="'+f+'" class="remove"><i class="fa fa-times"></i></span><span class="move"><i class="fa fa-sort"></i></span></div>';b("#file-upload-container").prepend(h);ads_thumbs=b("#qa_ads_thumbs").val();if(ads_thumbs==""){ads_thumbs=f}else{ads_thumbs=ads_thumbs+","+f}b("#qa_ads_thumbs").val(ads_thumbs)}})}};a.init()});